import React from "react";

function Cart({onOrder, cartItems}) {
    return (
        <div className="cart">
            <h1>Cart</h1>
            <div className="cart-items">
                {cartItems.uniq.map(item => 
                    <h3 className="cart-item">{item.name}</h3>
                )}
            </div>
            <p>Total: ${parseFloat(cartItems.reduce((total, item) => total + item.price, 0)).toFixed(2)}</p>
            <button className="order-button">Order</button>
        </div>
    )
}

export default Cart
